--
-- Table structure for table `f_pre`
--

CREATE TABLE `f_pre` (
  `adsh` varchar(20) COLLATE latin1_general_cs NOT NULL COMMENT 'Accession Number. The 20-character string formed from the 18-digit number assigned by the SEC to each EDGAR submission.',
  `report` int(11) NOT NULL COMMENT 'Represents the report grouping. This field corresponds to the statement (stmt) field, which indicates the type of statement. The numeric value refers to the ''R file'' as posted on the EDGAR Web site.',
  `line` int(11) NOT NULL COMMENT 'Represents the tag''s presentation line order for a given report. Together with the statement and report field, presentation location, order and grouping can be derived.',
  `stmt` varchar(2) COLLATE latin1_general_cs NOT NULL COMMENT 'The financial statement location to which the value of the ''report field pertains.',
  `inpth` tinyint(1) NOT NULL COMMENT 'Value was presented ''parenthetically'' instead of in columns within the financial statements. For example: Receivables (net of allowance for bad debts of $200 in 2012) $700.',
  `rfile` varchar(1) COLLATE latin1_general_cs NOT NULL COMMENT 'The type of interactive data file rendered on the EDGAR web site, H = .htm file, X = .xml file.',
  `tag` varchar(256) COLLATE latin1_general_cs NOT NULL COMMENT 'The tag chosen by the filer for this line item.',
  `version` varchar(20) COLLATE latin1_general_cs NOT NULL COMMENT 'The taxonomy identifier if the tag is a standard tag, otherwise adsh.',
  `plabel` varchar(512) COLLATE latin1_general_cs NOT NULL COMMENT 'The text presented on the line item, also known as a ''preferred'' label.',
  `negating` tinyint(4) DEFAULT NULL COMMENT 'column not defined in documentation'
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_cs;

