--
-- Table structure for table `f_tag`
--

CREATE TABLE `f_tag` (
  `tag` varchar(256) COLLATE latin1_general_cs NOT NULL COMMENT 'The unique identifier (name) for a tag in a specific taxonomy release.',
  `version` varchar(20) COLLATE latin1_general_cs NOT NULL COMMENT 'For a standard tag, an identifier for the taxonomy; otherwise the accession number where the tag was defined.',
  `custom` tinyint(1) NOT NULL COMMENT '1 if tag is custom (version=adsh), 0 if it is standard. Note: This flag is technically redundant with the ''version and adsh columns.',
  `abstract` tinyint(1) NOT NULL COMMENT '1 if the tag is not used to represent a numeric fact.',
  `datatype` varchar(20) COLLATE latin1_general_cs DEFAULT NULL COMMENT 'If abstract=1, then NULL, otherwise the data type (e.g., monetary) for the tag.',
  `iord` varchar(1) COLLATE latin1_general_cs NOT NULL COMMENT 'If abstract=1, then NULL; otherwise, ''I'' if the value is a point-in time, or ''D'' if the value is a duration.',
  `crdr` varchar(1) COLLATE latin1_general_cs DEFAULT NULL COMMENT 'If datatype = monetary, then the tag''s natural accounting balance (debit or credit); if not defined, then NULL.',
  `tlabel` varchar(512) COLLATE latin1_general_cs DEFAULT NULL COMMENT 'If a standard tag, then the label text provided by the taxonomy, otherwise the text provided by the filer.'' A tag which had neither would have a NULL value here.',
  `doc` varchar(2048) COLLATE latin1_general_cs DEFAULT NULL COMMENT 'The detailed definition for the tag (truncated to 2048 characters). If a standard tag, then the text provided by the taxonomy, otherwise the text assigned by the filer.'' Some tags have neither, and this field is NULL.'
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_cs;

